const Ticker1=({img})=>{
    return(
    <Ticker>
    {({ }) => (
        <div>
        img.map((item)=>(
        <div className='ticker-item'>
            <img src={item} alt=""/>
        </div>
        ))
        </div>
    )}
</Ticker>)
}
export default Ticker1
